import React from 'react'
import Styles from "../Home.module.css";


const Home = () => {
    return (

      <div className={Styles.div}>
        <div className={Styles.home.div}>
          <p className={Styles.text.pt-3}>WELCOME</p>
          <h1>we are the MERN develeoper</h1>
        </div>
        </div>
    )
}

export default Home
